import React from 'react';
import ReactDOM, { createRoot } from 'react-dom';
import { GoogleLogin } from '@react-oauth/google';

import './App.css';
import QuizComponent from './QuizComponent';
import { GoogleOAuthProvider } from '@react-oauth/google';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <GoogleOAuthProvider clientId="818715484116-lk0u6hiqoi4s4rgt559pq7i3v7p06eep.apps.googleusercontent.com">
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </GoogleOAuthProvider>
);

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const responseGoogle = (response) => {
    console.log(response);
    if (response.profileObj) {
      setIsLoggedIn(true);
    }
  };

  return (
    <div className="App">
      {!isLoggedIn ? (
        <div>
          <h1>Welcome to My App</h1>
          <GoogleLogin
            clientId="818715484116-lk0u6hiqoi4s4rgt559pq7i3v7p06eep.apps.googleusercontent.com" // replace with your Google client ID
            buttonText="Login with Google"
            onSuccess={responseGoogle}
            onFailure={responseGoogle}
            cookiePolicy={'single_host_origin'}
          />
        </div>
      ) : (
        <QuizComponent />
      )}
    </div>
  );
}

export default App;
